import type { CoordinateData, Player, TimeMarker, ImageAlignment, LogMetadata } from "@/types"
import { generatePlayerColor } from "@/components/color-utils"
import { Button } from "@/components/ui/button"

export default function ValkyrieOracle() {
  const [coordinateData, setCoordinateData] = useState<CoordinateData[]>([])
  const [players, setPlayers] = useState<Player[]>([])
  const [metadata, setMetadata] = useState<LogMetadata | null>(null)
  const [currentTime, setCurrentTime] = useState(0)
  const [timeMarkers, setTimeMarkers] = useState<TimeMarker[]>([])
  const [is3D, setIs3D] = useState(false)
  const [isPlayback, setIsPlayback] = useState(false)
  const [imageAlignment, setImageAlignment] = useState<ImageAlignment | null>(null)
  const [isPathViewEnabled, setPathViewEnabled] = useState(false)

  const handleFileUpload = (data: CoordinateData[], logMetadata: LogMetadata) => {
    setCoordinateData(data)
    setMetadata(logMetadata)

    // Extract unique players and count their entries
    const playerCounts = new Map<string, number>()
    const playerTimestamps = new Map<string, { min: number; max: number }>()
    
    data.forEach((d) => {
      playerCounts.set(d.player, (playerCounts.get(d.player) || 0) + 1)
      
      const current = playerTimestamps.get(d.player)
      if (!current) {
        playerTimestamps.set(d.player, { min: d.timestamp, max: d.timestamp })
      } else {
        playerTimestamps.set(d.player, {
          min: Math.min(current.min, d.timestamp),
          max: Math.max(current.max, d.timestamp)
        })
      }
    })

    const usedColors = new Set<string>()
    const uniquePlayers = Array.from(playerCounts.entries())
      .map(([name, count]) => {
        const timestamps = playerTimestamps.get(name)!
        const color = generatePlayerColor(name, usedColors)
        usedColors.add(color)
        
        return {
          name,
          enabled: true,
          color,
          entryCount: count,
          earliestAppearance: timestamps.min,
          latestAppearance: timestamps.max,
        }
      })
      .sort((a, b) => b.entryCount - a.entryCount)

    setPlayers(uniquePlayers)
  }

  const togglePlayer = (playerName: string) => {
    setPlayers((prev) => prev.map((p) => (p.name === playerName ? { ...p, enabled: !p.enabled } : p)))
  }

  const toggleAllPlayers = (enabled: boolean) => {
    setPlayers((prev) => prev.map((p) => ({ ...p, enabled })))
  }

  return (
    <div className="h-screen flex flex-col bg-background">
      {/* Header */}
      <header className="border-b border-primary/30 bg-card/50 backdrop-blur-sm">
        <div className="container mx-auto px-6 py-4">
          <div className="flex items-center gap-3">
            <div className="w-10 h-10 bg-primary/20 rounded-lg flex items-center justify-center border border-primary/50">
              <svg className="w-6 h-6 text-primary" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M13 10V3L4 14h7v7l9-11h-7z" />
              </svg>
            </div>
            <div>
              <h1 className="text-2xl font-bold text-primary rune-text tracking-wider">Valkyrie Oracle</h1>
              <p className="text-xs text-muted-foreground">Coordinate Visualization System</p>
            </div>
          </div>
        </div>
      </header>

      {/* Main Content */}
      <div className="flex-1 flex overflow-hidden">
        <aside className="w-[45%] border-r border-border bg-card/30 backdrop-blur-sm flex flex-col">
          <div className="flex-1 overflow-y-auto p-4 space-y-4">
            <CollapsibleSection title="Data Import" description="Upload and configure log data">
              <div className="grid grid-cols-2 gap-3">
                <div>
                  <FileUpload onUpload={handleFileUpload} onDataLoaded={(data, result) => {
                    // Data is loaded but not yet plotted
                    console.log('Data loaded:', data.length, 'coordinates')
                  }} />
                </div>
                <div>
                  <ImageOverlay alignment={imageAlignment} metadata={metadata} onAlignmentChange={setImageAlignment} />
                </div>
              </div>
            </CollapsibleSection>

            <CollapsibleSection title="Vikings" description="Toggle player visibility">
              <PlayerList players={players} onTogglePlayer={togglePlayer} onToggleAll={toggleAllPlayers} />
            </CollapsibleSection>

            <CollapsibleSection title="Playback Controls" description="Timeline and speed controls">
              <TimelineControls
                data={coordinateData}
                currentTime={currentTime}
                timeMarkers={timeMarkers}
                isPlayback={isPlayback}
                onTimeChange={setCurrentTime}
                onMarkersChange={setTimeMarkers}
                onPlaybackToggle={setIsPlayback}
              />
            </CollapsibleSection>
          </div>
        </aside>

        <main className="flex-1 flex">
          <CoordinateViewer
            data={coordinateData}
            players={players}
            currentTime={currentTime}
            is3D={is3D}
            isPlayback={isPlayback}
            timeMarkers={timeMarkers}
            metadata={metadata}
            imageAlignment={imageAlignment}
            isPathViewEnabled={isPathViewEnabled}
            onToggle3D={setIs3D}
            onTogglePlayback={setIsPlayback}
            onTogglePathView={setPathViewEnabled}
          />
        </main>
      </div>
    </div>
  )
}
