type SortType = "entries-high" | "entries-low" | "a-z" | "z-a" | "earliest" | "latest"

export function PlayerList({ players, onTogglePlayer, onToggleAll }: PlayerListProps) {
  const [sortType, setSortType] = useState<SortType>("entries-high")
  const allEnabled = players.every((p) => p.enabled)
  const allDisabled = players.every((p) => !p.enabled)

  const sortedPlayers = useMemo(() => {
    const sorted = [...players]
    switch (sortType) {
      case "a-z":
        sorted.sort((a, b) => a.name.localeCompare(b.name))
        break
      case "z-a":
        sorted.sort((a, b) => b.name.localeCompare(a.name))
        break
      case "entries-high":
        sorted.sort((a, b) => b.entryCount - a.entryCount)
        break
      case "entries-low":
        sorted.sort((a, b) => a.entryCount - b.entryCount)
        break
      case "earliest":
        sorted.sort((a, b) => a.earliestAppearance - b.earliestAppearance)
        break
      case "latest":
        sorted.sort((a, b) => b.latestAppearance - a.latestAppearance)
