    if (metadata && metadata.radius > 0) {
      const { centerX, centerZ, radius } = metadata
      setCalculatedCoords({
        nw: { x: centerX - radius, z: centerZ - radius },
        se: { x: centerX + radius, z: centerZ + radius },
      })
    }
  }, [metadata])

  // Cleanup object URL on unmount or when imageUrl changes
  useEffect(() => {
    return () => {
      if (imageUrl && imageUrl.startsWith('blob:')) {
