{"output":"# Valkyrie Plotting Tool - Visual Design Document

This document records the key design and user experience (UX) decisions for the Valkyrie Plotting Tool.

## 1. Core Interaction

### 1.1. Automatic Plotting

- **Decision**: Coordinate data is parsed and plotted on the map immediately upon successful file import.
- **Rationale**: This provides immediate visual feedback to the user and streamlines the workflow.
- **Implementation Details**: The file import handler will directly call the `parseCoordinateFile` function. On a successful result, the `data` array from the result will be set in the application's state, triggering a re-render of the plot view component with the new points.
- **Example Code**:
  ```jsx
  // In the main application component
  const handleFileImport = (fileContent) => {
    const result = parseCoordinateFile(fileContent);
    if (result.success) {
      setParsedData(result.data); // This state update triggers the plot
    } else {
      // Handle and display errors
    }
  };
  ```

---

## 2. Playback Mode

### 2.1. Step-Based Playback

- **Decision**: The playback functionality operates on a step-based system, advancing from one log entry to the next, rather than a continuous, linear time-based system.
- **Rationale**: This makes the playback more meaningful by focusing only on moments where activity occurs, automatically skipping long periods of inactivity.
- **Implementation Details**:
  - Manage playback state using an index (e.g., `logIndex`) instead of a timestamp.
  - The playback slider's range will be from `0` to `data.length - 1`.
  - The "Play" action will increment the `logIndex` at a set interval.
- **Example Code**:
  ```jsx
  const [logIndex, setLogIndex] = useState(0);
  const maxSteps = parsedData.length - 1;

  const handlePlay = () => {
    setInterval(() => {
      setLogIndex(prevIndex => Math.min(prevIndex + 1, maxSteps));
    }, 200); // Advance every 200ms
  };

  // The slider component would be bound to logIndex
  <Slider
    min={0}
    max={maxSteps}
    value={logIndex}
    onValueChange={setLogIndex}
  />
  ```

### 2.2. Time Context Display

- **Decision**: The playback UI will display two key pieces of temporal information:
  1.  The absolute timestamp of the _current_ log entry.
  2.  The relative elapsed time between the current log entry and the previous one.
- **Rationale**: This provides users with a clear understanding of both the specific time of an event and the pace of the action, highlighting rushes of activity or long pauses.
- **Implementation Details**:
  - The current event time is read directly from `data[logIndex].timestamp`.
  - The elapsed time is the difference between `data[logIndex].timestamp` and `data[logIndex - 1].timestamp`. This calculation should handle the edge case where `logIndex` is `0`.
- **Example Code**:
  ```jsx
  const currentEntry = parsedData[logIndex];
  const previousEntry = parsedData[logIndex - 1];

  const currentTime = new Date(currentEntry.timestamp).toLocaleString();
  let elapsedTime = "Start";
  if (previousEntry) {
    const diffInSeconds = (currentEntry.timestamp - previousEntry.timestamp) / 1000;
    elapsedTime = `+${diffInSeconds.toFixed(1)}s`;
  }

  // In the UI
  <div>
    <span>{currentTime}</span>
    <span>({elapsedTime})</span>
  </div>
  ```

---

## 3. Path View (Detailed Visualization)

### 3.1. Performance-Aware Feature

- **Decision**: The "Path View" is an opt-in feature, disabled by default. It can only be enabled when the user has selected between 1 and 4 players for analysis.
- **Rationale**: Rendering detailed paths with markers for many players can be performance-intensive. This design offers a powerful analysis tool while ensuring the application remains responsive for general use.
- **Implementation Details**:
  - Maintain state for `selectedPlayers` (an array or Set of player names) and `isPathViewEnabled` (a boolean).
  - The "Enable Path View" toggle switch in the UI will be disabled if `selectedPlayers.length` is not between 1 and 4.
  - The 3D plot component will conditionally render the detailed path component only when `isPathViewEnabled` is true.
- **Example Code**:
  ```jsx
  const [selectedPlayers, setSelectedPlayers] = useState(new Set());
  const [isPathViewEnabled, setPathViewEnabled] = useState(false);

  const canEnablePathView = selectedPlayers.size > 0 && selectedPlayers.size <= 4;

  // In the Plot View component
  {isPathViewEnabled && canEnablePathView && <PlayerPaths data={filteredData} />}
  ```

### 3.2. Path Styling

- **Decision**: When enabled, player paths will be styled to convey maximum information, even in a static image.
  - **Line Style**:
    - A **solid line** connects points for continuous movement.
    - A **dotted line** represents a "large gap" in log entries, indicating a player may have left the area and returned.
  - **Path Markers**:
    - **Start Point**: An empty circle `O` marks the beginning of a player's path segment.
    - **End Point**: An 'X' marks the final recorded position in the segment.
    - **Direction**: Small arrows `>` are placed along the path to indicate the direction of movement.
- **Rationale**: These visual cues make the plot self-documenting, allowing for intuitive analysis of player movement, direction, and periods of inactivity at a glance.
- **Implementation Details**:
  - Before rendering, group the filtered data points by player.
  - For each player's path, iterate through their points. Calculate the time difference between the current and previous point.
  - If the difference is below a defined threshold (e.g., 5 minutes), draw a segment using `three.js` `Line` with `LineBasicMaterial`.
  - If the difference is above the threshold, draw a segment using `Line` with `LineDashedMaterial`.
  - Render special geometry (a torus for the circle, merged lines for the 'X') at the start and end points of each player's path.
- **Example Code**:
  ```jsx
  // Conceptual logic within a PlayerPaths component
  const GAP_THRESHOLD_MS = 5 * 60 * 1000;

  playerData.forEach(points => {
    for (let i = 1; i < points.length; i++) {
      const prev = points[i-1];
      const curr = points[i];
      const timeDiff = curr.timestamp - prev.timestamp;
      
      const isGap = timeDiff > GAP_THRESHOLD_MS;
      const material = isGap ? new LineDashedMaterial(...) : new LineBasicMaterial(...);
      
      // ... logic to create and add line segment to the scene
    }
  });
  ```

---

## 4. Viewport and Grid

### 4.1. Adaptive Grid Positioning

- **Decision**: The grid's vertical position (`Y` coordinate) adapts based on the current view mode.
  - In **2D Mode (Top-Down)**, the grid is positioned at `Y = 0` to serve as a standard reference plane.
  - In **3D Mode**, the grid's `Y` coordinate is set to match the `Y` value of the user-defined "Center Point" from the UI.
- **Rationale**: This ensures that in 3D view, the grid acts as a relevant floor or reference plane based on user input, preventing it from obscuring data points that may be below `Y=0`. In 2D view, it maintains a consistent, standard top-down perspective.
- **Implementation Details**:
  - The main UI will have a state for the center point coordinates, e.g., `centerPoint = { x: 0, y: 0, z: 0 }`.
  - The `PlotView` component will receive `centerPoint.y` as a prop.
  - A state variable `viewMode` (`'2d' | '3d'`) will control the rendering logic.
  - The `position` of the `<Grid>` component from `@react-three/drei` will be set conditionally.
- **Example Code**:
  ```jsx
  // In the PlotView component
  function PlotView({ data, centerPointY, viewMode }) {
    const gridYPosition = viewMode === '3d' ? centerPointY : 0;

    return (
      <Canvas>
        {/* ... cameras and controls ... */}
        <Grid position={[0, gridYPosition, 0]} />
        {/* ... data points ... */}
      </Canvas>
    );
  }
  ```

---

## 5. UI Controls and Styling

### 5.1. Button and Layout Consistency

- **Decision**: Move from adaptive, container-dependent button sizing to a uniform, explicit sizing model using fixed dimensions and consistent text sizes. Layouts will use `flex` and `gap` for efficient and clean spacing.
- **Rationale**: Adaptive sizing and individual margins can lead to an inconsistent and inefficient layout with excessive spacing. A uniform design provides a more professional, readable, and predictable user interface.
- **Implementation Details**:
  - **Button Sizing**: Buttons will use fixed width and height classes (e.g., `w-24 h-10`) instead of only padding to ensure uniformity regardless of text content. Text size will be increased (e.g., `text-sm`) for better readability.
  - **Layout Spacing**: Control groups will be wrapped in a `flex` container. Spacing will be managed with the `gap` utility (e.g., `gap-2`) to create consistent space *between* elements, eliminating unnecessary external margins.

- **Example - Consistent Button Style**:
  ```jsx
  // A consistent, fixed-size button style using Tailwind CSS
  <button className="w-24 h-10 px-3 text-sm font-medium rounded bg-slate-700 text-white hover:bg-slate-600 focus-visible:ring-2 focus-visible:ring-offset-2 focus-visible:ring-slate-500">
    Reset
  </button>
  ```

- **Example - Efficient Layout**:
  ```jsx
  // A compact group of controls using flex and gap
  <div className="flex items-center gap-2">
    <button className="w-24 h-10 ...">Reset</button>
    <button className="w-10 h-10 ...">+</button>
    <button className="w-10 h-10 ...">-</button>
  </div>
  ```
