export function parseColorToThree(input: string): THREE.Color {
    try {
        return new THREE.Color(input)
    } catch (err) {
        console.error(`Failed to parse color "${input}":`, err)
        return new THREE.Color(0xffffff) // Default to white on error
    }
}

// Returns a CSS-compatible string representation of a color.
export function cssColor(input: string): string {
    return parseColorToThree(input).getStyle()
}

// Generate a unique color for a player based on their name
export function generatePlayerColor(name: string, usedColors: Set<string>): string {
    // A palette of vibrant, distinct hex colors
    const colors = [
        "#FFD700", // Gold
        "#87CEEB", // Sky Blue (Ice Blue)
        "#CD7F32", // Bronze
        "#2E8B57", // Sea Green
        "#FF00FF", // Magenta
        "#FFFF00", // Yellow
        "#8A2BE2", // Blue Violet (Purple)
        "#00FFFF", // Cyan
    ]

    // Generate a hash from the player's name to start with a pseudo-random color
    let hash = 0
    for (let i = 0; i < name.length; i++) {
        hash = name.charCodeAt(i) + ((hash << 5) - hash)
        hash = hash & hash // Convert to 32bit integer
    }

    // Try to find an available color from the predefined palette
    for (let i = 0; i < colors.length; i++) {
        const index = (hash + i) % colors.length
        const color = colors[index]
        if (!usedColors.has(color)) {
            return color
        }
    }

    // If all predefined colors are used, generate a random hex color
    // and ensure it's not already in use (highly unlikely, but good practice)
    let randomColor: string
    do {
        randomColor = `#${Math.floor(Math.random() * 16777215).toString(16).padStart(6, '0')}`
    } while (usedColors.has(randomColor))
    
    return randomColor
}
